    - <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2"><strong>Peripheral                        senstization </strong></font></p>                     <ul><li><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size="-2">1,2,3</font></font></li><li> <font face="Verdana, Arial, Helvetica, sans-serif" size="2">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size="-2">1,2,3                          </font></font></li><li><font face="Verdana, Arial, Helvetica, sans-serif" size="2">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size="-2">1,2,5                          </font></font></li></ul>
