 Helvetica, sans-serif\" size=\"2\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\"-3\">                          1,2,4 </font></font></li></ul> </body> </html>"
